function recursiveIDs(){

   service.nearbySearch({location: slo, radius:5000, type:types[typenum]}, recurIDHandle);

function recurIDHandle(results, status){

      for(var i = 0; i < results.length; i++){
         ids.push(results[i].place_id);
      }
      typenum++;
      if(typenum < types.length){
         setTimeout(recursiveIDs, 50);

         console.log("done");
      }
   }else if(status === google.maps.places.PlacesServiceStatus.ZERO_RESULTS){

      typenum++;

         setTimeout(recursiveIDs, 50);

         console.log("done");
      }
   }else{
      //console.log("fail, trying again");

      setTimeout(recursiveIDs, 1000);

   for(var i = 0; i < ids.length; i++){
      fids[ids[i]] = ids[i];
   }
   var i = 0;
   ids = [];
   for(key in fids){
      ids.push(fids[key]);
   }
}
function getDetails(){
   var decount = 0;
   while(decount < ids.length){
      (function(){
         var incount = decount;
         setTimeout(function(){grabID(incount);}, 50*decount);
      })();
      decount++;
   }
}
function grabID(counter){
   service.getDetails({placeId:ids[counter]},
         function(place, status){
            if(status === google.maps.places.PlacesServiceStatus.OK){
               console.log(counter);
               places.push(place); 
            }else{
               //console.log(counter + " error");
               setTimeout(grabID(counter), counter * 10000);
            }
            
         }); 
}
function iterDeets(beg, end){
   while(beg<end){
      setTimeout((function(){var ibeg = beg;return function(){getDeets(ibeg)};})(),1000*(end-beg)); 
      beg++;
   }
}
function getDeets(id){
          //console.log(id);
          //console.log(ids[id]); 
          service.getDetails({placeId:ids[id]}, function(place, status){
          
            if(status === google.maps.places.PlacesServiceStatus.OK){
               places.push(place);
               document.getElementById("count").innerHTML = places.length;
            }else{
               setTimeout(function(){ return getDeets(id);}, id%10 * 300);
            }
          
          });
}
